import React from "react";
import { Link } from "react-router-dom";
import "./Articles.css";

const Articles = () => {
  const articles = [
    { id: 1, title: "The Role of Evidence in Legal Proceedings", description: "A brief look at how evidence shapes the outcome of legal cases." },
    { id: 2, title: "Understanding Ethiopian Property Law", description: "Insights into property ownership and rights under Ethiopian law." },
    { id: 3, title: "The Evolution of Corporate Law", description: "How corporate law has changed over the years to meet modern needs." },
  ];

  return (
    <div className="articles-page">
      <h1>Articles</h1>
      <div className="articles-list">
        {articles.map(article => (
          <div className="article-box" key={article.id}>
            <h2>{article.title}</h2>
            <p>{article.description}</p>
            <Link to={`/articles/${article.id}`} className="see-more-button">
              See More
            </Link>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Articles;
